import React from "react";

const alert = (props) => {
	return (
		<div
			className={`px-4 py-3 w-10/12 leading-normal ${props.text_color} ${props.bg_color} rounded-lg`}
			role="alert"
		>
			<p>{props.msg}</p>
		</div>
	);
};

export default alert;
